import React, {Component} from 'react';
import ContactInfo from './ContactInfo.js'
import {Container, Row} from 'react-bootstrap';
import {faAt, faPhone} from '@fortawesome/free-solid-svg-icons';
import './App.css';


class Header extends Component {

    render(){
        return (
            <Container >
                <h1 className="Title">MIKHAIL GORBACHEV</h1>
                <p className="Tagline">It's not garbage, it's gorbachev baby</p>
                <Row>
                    <ContactInfo icon={faAt} contact="mikkyTheCommieSlayer69@yahoo.com"/>
                    <ContactInfo icon={faPhone} contact="123456789"/>
                </Row>
            </Container>
        )
    }

} export default Header
